import style from './ValidaGRT.module.scss'

export const ValidaGRT = ({ user, veiculo }) => {

    const teste = 'teste'

    return (
        <>
            <div className={style.impressao}>
                <p className={style.iten1} >{teste}</p>
                <p className={style.iten2}>{teste}</p>
                <p className={style.iten3}>{teste}</p>
            </div>
        </>
    )
}
